import React from 'react';
import './css/App.css';
import HomePage from './components/homepage';
import SignInPage from './components/signinpage';
import SignUpPage from './components/signuppage';
import UploadFilePage from './components/uploadfilepage';
import SignalVisualizationPage from './components/signalvisualizationpage';
import ProfilePage from './components/profilepage';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

let authenticated = false;

function getAutenticated(authFromChild) {
  this.authenticated = authFromChild;
}

function requireAuth(nextState, replace, next) {
  if (!authenticated) {
    replace({
      pathname: "/login",
      state: {nextPathname: nextState.location.pathname}
    });
  }
  next();
}

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path='/' exact component={HomePage}/>
          <Route path='/join/signup' component={SignUpPage}/>
          <Route path='/join/signin' component={SignInPage} getAuth = {this.getAutenticated.bind(this)}/>
          <Route path='/upload' component={UploadFilePage} onEnter={requireAuth}/>
          <Route path='/data' component={SignalVisualizationPage} onEnter={requireAuth}/>
          <Route path='/profile' component={ProfilePage} onEnter={requireAuth}/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
